import React from 'react';
import "./header.css";

export default function Header() {
    return (
        <div className="header">
            <div className="headerTitles">
                <span className="headerTitlesSm">PUNE INSTITUTE OF COMPUTER TECHNOLOGY</span>
                <span className="headerTitlesLg">LOST & FOUND</span>
            </div>
            <img className="headerImg"
        src="https://media.istockphoto.com/vectors/lost-found-box-vector-id477273563?k=20&m=477273563&s=612x612&w=0&h=NEADYfbDc3BeJuLg9Dv1oI0-8Gq9jkoef2YZvE5AOJc="
        alt=""
      />
            
        </div>
    )
}
